import React from "react";
import { Container, Header, Button } from "semantic-ui-react";

import "../App.css";

const Counter = () => (
  <div className="counter">
    <Container text>
      <Header as="h1">0</Header>
    </Container>
    <Button.Group>
      <Button color="red">DECREMENT</Button>
      <Button>RESET</Button>
      <Button color="green">INCREMENT</Button>
    </Button.Group>
  </div>
);

export default Counter;
